State moves to delete the enhancers in both count 1 and count 3.  Motion granted.
NO CONTEST to the amended charge in count 1, manuf/deliver amphetamine.  Convicted.
NO CONTEST to the amended charge in count 3, manuf/deliver schedule I, II narcotics.  Convicted.
State moves to dismiss and read in counts 2.  Motion granted.
Count 1 - Sentence withheld and defendant is placed on probation to DOC for four (4) years.
Conditions of probation:
1) Comply with drug court rules;
2) AODA assessment and follow through;
3) Maintain absolute sobriety;
4) Reimburse $250.00 buy money to Metro drug unit; 
5) Pay court costs;
6) Pay supervision fees in an amount to be determined by DOC;
7) Provide DNA sample
8) Submit to random urine screens and pay for same;
9) Spend twelve (12) months in the county jail, under the Huber Law, stayed and to be imposed at the agents discretion and upon order of the court.
Count 2 -  Court approves the 3 year Deferred Judgment Agreement and will sign it - State to prepare DJA for Court's signature. 
Minutes.
